    false,nt"url": null,nt"notes": "NODC Accession 0104349 includes physical
    and underway data collected aboard the THOMAS G. THOMPSON during cruise TN230 in
    the South Pacific Ocean from 2009-03-01 to 2009-03-12. These data include CONDUCTIVITY,
    CURRENT SPEED - EAST/WEST COMPONENT (U), CURRENT SPEED - NORTH/SOUTH COMPONENT (V),
    DEPTH - BOTTOM, DEPTH - OBSERVATION, HYDROSTATIC PRESSURE, SALINITY and WATER TEMPERATURE.
    The instruments used to collect these data include ADCP, CTD, GPS and echo sounder.
    These data were collected by Richard Keil of University of Washington as part of
    Student Cruise. The Lamont-Doherty Earth Observatory (LDEO) submitted these data
    to NODC as part of the NSF sponsored Rolling Deck to Repository (R2R) program.nnThe
    CTD data submitted by the originator represent the raw data suite. Processed versions
    of the data were generated by NODC. The ADCP data represent the raw and automated
    processed data set. Post processed quality assessed data are not available in this
    accession.",nt"license_title": null,nt"extras": [{ntt"key": "bbox-east-long",ntt"value":
